angular.module("app").run(["$templateCache",function(t){t.put("templates/widgets/tab-bar.html",'<div class="tab-bar"><div class="tab tradeGothicBold" ng-repeat-start="tab in $ctrl.tabs" ng-click="$ctrl.tabClick(tab)" ng-class="{\'tab-active\': tab === $ctrl.selectedTab}">{{tab.title}}<div class="triangle" ng-show="tab === $ctrl.selectedTab"></div></div><div class="separator" ng-repeat-end="ng-repeat-end" ng-hide="$last"></div></div>')}]);